public int[] getInts(String name) {
  String[] strings = getTrimmedStrings(name);
  int[] ints = new int[strings.length];
  for (int i = 0; i < strings.length; i++) {
    ints[i] = Integer.parseInt(strings[i]);
  }
  return ints;
}
